const RegisterPage = () => {

    function Header() {

        return(
            <header>
                <h2>AeroParker</h2>
            </header>
        )
    }

    function SubmitForm() {
        
            const { register, formState: {errors} } = useForm()
        let handleSubmit = async (e) =>{
            e.preventDefault();

            const username = e.target.Username.value;
            const password = e.target.Password.value;

            console.log('username: ' + username + "\npassword: " + password);
            try {
                await fetch("https://localhost:7166/Login", {
                    method: "POST",
                    headers: {
                        "content-type": "application/json"
                    },
                    body: JSON.stringify({
                        username: username,
                        password: password
                    }),
                })
                .then(response => response.json())
                .then(data => {
                    console.log(data)
                    localStorage.setItem("jwtToken", data.token);
                    setIsLoggedIn(true);
                    navigate("/Home")
                })
            } catch (err){
                console.log(err);
            }
        }

        return (
            <form onSubmit={(e) => handleSubmit(e)}>
            <div className="form-group username">
                <label>Username</label>
                <input className='inputText' id='Username' type='text' placeholder='Username' {...register('Username', {required: true})} />
                {errors.Username && <p>Username is incorrect</p>}
            </div>

            <div className="form-group password">
                <label>Password</label>
                <input className='inputText' id='Password' type='password' placeholder='Password' {...register('Password', {required: true})} />
                {errors.Password && <p>Password is incorrect</p>}
            </div>

            <div id='onSuccess'></div>

            <input className='inputLogin' type='submit' value={"Login"} onClick={() => { document.getElementById("onSuccess").innerHTML = "Loading...";}} />
            <Link className='link' to={"/SignUp"}>Sign up</Link>
            </form>
        )
    }

    return(
    <div>
        <Header />
    </div>
    )
}

export default RegisterPage;
